import React, { useEffect } from 'react';
import Item from './UI/Item/Item';

const Finalists = () => {
    const catData = {
        Pre_Teen: [
            {
                name: "Thabo Test",
                age: "9",
                image: "img/testPic.jpg"
            },
            {
                name: "Dudu Test",
                age: "9",
                image: "img/testPic.jpg"
            }
        ],
        Jnr_Teen: [
            {
                name: "Thabo Test",
                age: "9",
                image: "img/testPic.jpg"
            },
            {
                name: "Dudu Test",
                age: "9",
                image: "img/testPic.jpg"
            }
        ],
        Teen: [
            {
                name: "Thabo Test",
                age: "9",
                image: "img/testPic.jpg"
            },
            {
                name: "Dudu Test",
                age: "9",
                image: "img/testPic.jpg"
            }
        ],
        Senior: [
            {
                name: "Thabo Test",
                age: "9",
                image: "img/testPic.jpg"
            },
            {
                name: "Dudu Test",
                age: "9",
                image: "img/testPic.jpg"
            }
        ],
        Miss_Drag: [
            {
                name: "Thabo Test",
                age: "9",
                image: "img/testPic.jpg"
            },
            {
                name: "Dudu Test",
                age: "9",
                image: "img/testPic.jpg"
            }
        ]
    }

    const [ data, setData ] = {
        Pre_Teen: [],
        Jnr_Teen: [],
        Teen: [],
        Senior: [],
        Miss_Drag: [],
        loading: false,
        error: false
    }
    useEffect(() => {
        const fetchPreTeen = catData.Pre_Teen.map((x) => (
            <Item 
                key={x.id}
                id={x.id}
                name={x.name}
                age={x.age}
                image={x.image}
                />
        ))
    })


    return (
        <div id='finalists' className='text-center'>
            <div className='container'>
                <div className='section-title'>
                    <h2>Our Finalists</h2>
                </div>
            </div>
        </div>
    )
};

export default Finalists;
